INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 1, 1, "", 0, 190804, "カリン", 1, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 1, 2, "", 1, 0, "", 2, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 1, 2, "", 1, 0, "", 3, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 2, 2, "", 1, 0, "", 4, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 1, 2, "", 2, 0, "", 5, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 1, 2, "", 2, 0, "", 6, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 2, 2, "", 2, 0, "", 7, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 1, 2, "", 3, 0, "", 8, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 1, 2, "", 3, 0, "", 9, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 1, 2, "", 3, 0, "", 10, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 1, 2, "", 3, 0, "", 11, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 2, 2, "", 3, 0, "", 12, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 1, 2, "", 4, 0, "", 13, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 1, 2, "", 4, 0, "", 14, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 1, 2, "", 4, 0, "", 15, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 1, 2, "", 4, 0, "", 16, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 2, 2, "", 4, 0, "", 17, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60000, 0, 0, 3, "", 0, 190804, "カリン", 18, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 60000, 0, 0, 3, "", 0, 190804, "カリン", 19, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80001, 0, 0, 0, "", 0, 101201, "ハツネ", 20, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80001, 0, 0, 0, "", 0, 101201, "ハツネ", 21, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80001, 0, 0, 1, "", 0, 103801, "シオリ", 22, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80001, 0, 0, 1, "", 0, 103801, "シオリ", 23, "来年も、\n一緒にいられたら…\nうれしいな", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80001, 0, 0, 0, "", 0, 103601, "キョウカ", 24, "あなたと一緒にいるようになって、\nもう1年ですか…", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80001, 0, 0, 0, "", 0, 103601, "キョウカ", 25, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80001, 0, 0, 1, "", 0, 102001, "ミミ", 26, "おにいちゃんとあってから、\n1年たったよ～！", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80001, 0, 0, 1, "", 0, 102001, "ミミ", 27, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80001, 0, 0, 2, "", 0, 100401, "ミソギ", 28, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80001, 0, 0, 2, "", 0, 100401, "ミソギ", 29, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80001, 0, 0, 0, "", 0, 101001, "マホ", 30, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80001, 0, 0, 0, "", 0, 101001, "マホ", 31, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80001, 0, 0, 1, "", 0, 104401, "イリヤ", 32, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80001, 0, 0, 1, "", 0, 104401, "イリヤ", 33, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80001, 0, 0, 2, "", 0, 101701, "カオリ", 34, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80001, 0, 0, 2, "", 0, 101701, "カオリ", 35, "これからも、どうぞよろしく\nお願いするさ～！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80001, 0, 0, 0, "", 0, 102801, "サレン", 36, "あんたと出会ってからもうそんなに\nたつのね～", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80001, 0, 0, 0, "", 0, 102801, "サレン", 37, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80001, 0, 0, 1, "", 0, 102501, "スズメ", 38, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80001, 0, 0, 1, "", 0, 102501, "スズメ", 39, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80001, 0, 0, 0, "", 0, 104601, "タマキ", 40, "振り返れば、今までいろんなことが\nあったにゃあ…", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80001, 0, 0, 0, "", 0, 104601, "タマキ", 41, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80001, 0, 0, 1, "", 0, 104801, "ミフユ", 42, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80001, 0, 0, 1, "", 0, 104801, "ミフユ", 43, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80001, 0, 0, 0, "", 0, 103201, "アキノ", 44, "あなたさまと出会ってもう1年…", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80001, 0, 0, 0, "", 0, 103201, "アキノ", 45, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80001, 0, 0, 1, "", 0, 103401, "ユカリ", 46, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80001, 0, 0, 1, "", 0, 103401, "ユカリ", 47, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80001, 0, 0, 0, "", 0, 107101, "クリスティーナ", 48, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80001, 0, 0, 0, "", 0, 107101, "クリスティーナ", 49, "ともかくこれからも\n愉しませてくれよ☆", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80001, 0, 0, 1, "", 0, 104701, "ジュン", 50, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80001, 0, 0, 1, "", 0, 104701, "ジュン", 51, "見えないから分からないって？\nそれもそうだな…", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80001, 0, 0, 0, "", 0, 103701, "トモ", 52, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80001, 0, 0, 0, "", 0, 103701, "トモ", 53, "これからもよろしくね！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80001, 0, 0, 1, "", 0, 100501, "マツリ", 54, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80001, 0, 0, 1, "", 0, 100501, "マツリ", 55, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80001, 0, 0, 0, "", 0, 100701, "ミヤコ", 56, "オマエと会って1年なの！\n全然成仏もできなかったし、", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80001, 0, 0, 0, "", 0, 100701, "ミヤコ", 57, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80001, 0, 0, 1, "", 0, 103101, "シノブ", 58, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80001, 0, 0, 1, "", 0, 103101, "シノブ", 59, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80001, 0, 0, 0, "", 0, 100901, "アンナ", 60, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80001, 0, 0, 0, "", 0, 100901, "アンナ", 61, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80001, 0, 0, 1, "", 0, 101301, "ナナカ", 62, "君と出会ってもう1年だって！\n早いねー！", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80001, 0, 0, 1, "", 0, 101301, "ナナカ", 63, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80001, 0, 0, 0, "", 0, 105101, "ミツキ", 64, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80001, 0, 0, 0, "", 0, 105101, "ミツキ", 65, "これからも、いろんなところを\n調べさせてね？", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80001, 0, 0, 1, "", 0, 105601, "ルカ", 66, "お前さんと出会ってもう1年か\n助太刀するつもりが", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80001, 0, 0, 1, "", 0, 105601, "ルカ", 67, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80001, 0, 0, 2, "", 0, 102701, "エリコ", 68, "早いものですわね、あなた様と\nお会いして、もう1年…", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80001, 0, 0, 2, "", 0, 102701, "エリコ", 69, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80001, 0, 0, 0, "", 0, 102301, "アヤネ", 70, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80001, 0, 0, 0, "", 0, 102301, "アヤネ", 71, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80001, 0, 0, 1, "", 0, 104201, "チカ", 72, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80001, 0, 0, 1, "", 0, 104201, "チカ", 73, "私のことを見守ってください\nできることなら、ずっと…", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80001, 0, 0, 2, "", 0, 102101, "クルミ", 74, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80001, 0, 0, 2, "", 0, 102101, "クルミ", 75, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80001, 0, 0, 0, "", 0, 104901, "シズル", 76, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80001, 0, 0, 0, "", 0, 104901, "シズル", 77, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80001, 0, 0, 1, "", 0, 101101, "リノ", 78, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80001, 0, 0, 1, "", 0, 101101, "リノ", 79, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80001, 0, 0, 0, "", 0, 100201, "ユイ", 80, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80001, 0, 0, 0, "", 0, 100201, "ユイ", 81, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80001, 0, 0, 1, "", 0, 100101, "ヒヨリ", 82, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80001, 0, 0, 1, "", 0, 100101, "ヒヨリ", 83, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80001, 0, 0, 2, "", 0, 100301, "レイ", 84, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80001, 0, 0, 2, "", 0, 100301, "レイ", 85, "キミに背中を預けられる日が、\n早くきますように", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80001, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 86, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80001, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 87, "これからもずっと、覚えていて\nくださいね！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80001, 0, 0, 1, "", 0, 105901, "コッコロ", 88, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80001, 0, 0, 1, "", 0, 105901, "コッコロ", 89, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80001, 0, 0, 2, "", 0, 106001, "キャル", 90, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80001, 0, 0, 2, "", 0, 106001, "キャル", 91, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 1, "", 0, 112101, "スズメ", 92, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 1, 0, "", 93, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 1, 0, "", 94, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 1, 0, "", 95, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 1, 0, "", 96, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 2, 2, "", 1, 0, "", 97, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 2, 0, "", 98, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 2, 0, "", 99, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 2, 0, "", 100, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 2, 0, "", 101, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 2, 2, "", 2, 0, "", 102, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 3, 0, "", 103, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 3, 0, "", 104, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 3, 0, "", 105, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 3, 0, "", 106, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 3, 0, "", 107, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 3, 0, "", 108, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 2, 2, "", 3, 0, "", 109, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 4, 0, "", 110, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 4, 0, "", 111, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 4, 0, "", 112, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 4, 0, "", 113, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 4, 0, "", 114, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 1, 2, "", 4, 0, "", 115, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 2, 2, "", 4, 0, "", 116, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60001, 0, 0, 3, "", 0, 112101, "スズメ", 117, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 60001, 0, 0, 3, "", 0, 112101, "スズメ", 118, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 3);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 119, "ヒューヒュー♪\nドンドンパフパフー♪", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 120, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 121, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80003, 0, 0, 2, "", 0, 106001, "キャル", 122, "え？　ちょっと\nいきなりなにっ？", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80003, 0, 0, 2, "", 0, 106001, "キャル", 123, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 124, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 125, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 3);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 126, "ですからその日に向けて\n今から気分を盛り上げているのです", 3);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80003, 0, 0, 2, "", 0, 106001, "キャル", 127, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 3);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 128, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 4);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 129, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 4);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80003, 0, 0, 2, "", 0, 106001, "キャル", 130, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 4);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 131, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 5);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80003, 0, 0, 0, "", 0, 106001, "キャル", 132, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 5);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80003, 0, 0, 1, "", 0, 190801, "カリン", 133, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80003, 0, 0, 0, "", 0, 106001, "キャル", 134, "げっ…カリンじゃない\nなんでもないわよ！", 6);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80003, 0, 0, 1, "", 0, 190801, "カリン", 135, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80003, 0, 0, 0, "", 0, 106001, "キャル", 136, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 7);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80003, 0, 0, 1, "", 0, 190801, "カリン", 137, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 3);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80003, 0, 0, 0, "", 0, 106001, "キャル", 138, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 8);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80003, 0, 0, 0, "", 0, 106001, "キャル", 139, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 9);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80003, 0, 0, 1, "", 0, 190801, "カリン", 140, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 4);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80003, 0, 0, 0, "", 0, 106001, "キャル", 141, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 10);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80003, 0, 0, 1, "", 0, 190801, "カリン", 142, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 5);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80003, 0, 0, 0, "", 0, 106001, "キャル", 143, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 11);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 144, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 6);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80003, 0, 0, 1, "", 0, 105801, "ペコリーヌ", 145, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 5);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 146, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 7);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 147, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 8);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80003, 0, 0, 1, "", 0, 105801, "ペコリーヌ", 148, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 6);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80003, 0, 0, 1, "", 0, 105801, "ペコリーヌ", 149, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 7);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 150, "あとは、牧場に素敵な温泉が\n出来たとか…", 9);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80003, 0, 0, 1, "", 0, 105801, "ペコリーヌ", 151, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 8);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 152, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 10);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80003, 0, 0, 1, "", 0, 105801, "ペコリーヌ", 153, "えへへ、ありがとうございます\nコッコロちゃん！", 9);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 154, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 11);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80003, 0, 0, 1, "", 0, 105801, "ペコリーヌ", 155, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 10);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 156, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 11);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80003, 0, 0, 1, "", 0, 106001, "キャル", 157, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 12);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 158, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 12);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80003, 0, 0, 1, "", 0, 106001, "キャル", 159, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 13);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 160, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 13);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80003, 0, 0, 1, "", 0, 106001, "キャル", 161, "…積極的？\nなんの話よ？", 14);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 162, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 14);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 163, "ムーサの町で\nきゃるきゃる～ん☆　って！", 15);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80003, 0, 0, 1, "", 0, 106001, "キャル", 164, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 15);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 165, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 16);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80003, 0, 0, 1, "", 0, 106001, "キャル", 166, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 16);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80003, 0, 0, 1, "", 0, 106001, "キャル", 167, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 17);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80003, 0, 0, 0, "", 0, 106001, "キャル", 168, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 18);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 169, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 12);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80003, 0, 0, 0, "", 0, 106001, "キャル", 170, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 19);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 171, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 13);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80003, 0, 0, 0, "", 0, 106001, "キャル", 172, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 20);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 173, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 14);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80003, 0, 0, 0, "", 0, 106001, "キャル", 174, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 21);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 175, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 15);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80003, 0, 0, 0, "", 0, 106001, "キャル", 176, "かくし芸？", 22);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 177, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 16);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80003, 0, 0, 0, "", 0, 106001, "キャル", 178, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 23);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 179, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 17);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80003, 0, 0, 2, "", 0, 106001, "キャル", 180, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 24);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 181, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 17);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 182, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 18);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80003, 0, 0, 2, "", 0, 106001, "キャル", 183, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 25);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 184, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 18);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80003, 0, 0, 2, "", 0, 106001, "キャル", 185, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 26);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80003, 0, 0, 2, "", 0, 106001, "キャル", 186, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 27);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80003, 0, 0, 2, "", 0, 106001, "キャル", 187, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 28);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 188, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 19);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 189, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 19);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80003, 0, 0, 2, "", 0, 106001, "キャル", 190, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 29);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80003, 0, 0, 0, "", 0, 106001, "キャル", 191, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 30);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80003, 0, 0, 0, "", 0, 106001, "キャル", 192, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 31);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80003, 0, 0, 0, "", 0, 106001, "キャル", 193, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 32);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80003, 0, 0, 0, "", 0, 106001, "キャル", 194, "あー\nあー\n…声、これで大丈夫かしら？", 33);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80003, 0, 0, 0, "", 0, 106001, "キャル", 195, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 34);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80003, 0, 0, 0, "", 0, 106001, "キャル", 196, "オイッスー☆", 35);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80003, 0, 0, 0, "", 0, 106001, "キャル", 197, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 36);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80003, 0, 0, 0, "", 0, 106001, "キャル", 198, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 37);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80003, 0, 0, 0, "", 0, 106001, "キャル", 199, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 38);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 200, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 20);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 201, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 21);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 202, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 22);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 203, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 23);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 204, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 24);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 205, "オイッスー☆", 25);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 206, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 26);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 207, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 27);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80003, 0, 0, 0, "", 0, 105901, "コッコロ", 208, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 28);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 209, "オイッスー☆", 20);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 210, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 21);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 211, "あと６日で2.5周年ですか…", 22);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 212, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 23);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 213, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 24);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 214, "オイッスー☆", 25);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 215, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 26);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 216, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 27);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 217, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 28);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 218, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 29);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 219, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 30);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 220, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 31);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 221, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 29);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 222, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 32);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 2, "", 0, 106001, "キャル", 223, "…………", 39);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 224, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 30);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 2, "", 0, 106001, "キャル", 225, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 40);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 226, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 33);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 2, "", 0, 106001, "キャル", 227, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 41);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 228, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 34);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 229, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 35);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 2, "", 0, 106001, "キャル", 230, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 42);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 231, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 31);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 2, "", 0, 106001, "キャル", 232, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 43);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 233, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 36);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80003, 0, 0, 0, "", 0, 190801, "カリン", 234, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 6);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80003, 0, 0, 0, "", 0, 190801, "カリン", 235, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 7);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80003, 0, 0, 0, "", 0, 190801, "カリン", 236, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 8);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80003, 0, 0, 0, "", 0, 190801, "カリン", 237, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 9);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80003, 0, 0, 0, "", 0, 190801, "カリン", 238, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 10);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80003, 0, 0, 0, "", 0, 190801, "カリン", 239, "次にコッコロさんですが\nこちらは発声練習をしています", 11);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80003, 0, 0, 0, "", 0, 190801, "カリン", 240, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 12);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80003, 0, 0, 0, "", 0, 190801, "カリン", 241, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 13);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80003, 0, 0, 0, "", 0, 190801, "カリン", 242, "あれ？\nもしかして緊張で気を失って…？", 14);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80003, 0, 0, 0, "", 0, 190801, "カリン", 243, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 15);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80003, 0, 0, 0, "", 0, 190801, "カリン", 244, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 16);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80003, 0, 0, 0, "", 0, 190801, "カリン", 245, "それでは\nまた明日お会いしましょう♪", 17);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80003, 0, 0, 0, "", 0, 106001, "キャル", 246, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 44);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80003, 0, 0, 2, "", 0, 105801, "ペコリーヌ", 247, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 37);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 248, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 32);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80003, 0, 0, 0, "", 0, 106001, "キャル", 249, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 45);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80003, 0, 0, 2, "", 0, 105801, "ペコリーヌ", 250, "ひどいですよぉキャルちゃ～ん！", 38);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 251, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 33);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80003, 0, 0, 2, "", 0, 105801, "ペコリーヌ", 252, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 39);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80003, 0, 0, 0, "", 0, 106001, "キャル", 253, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 46);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 254, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 34);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80003, 0, 0, 2, "", 0, 105801, "ペコリーヌ", 255, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 40);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 256, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 41);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 2, "", 0, 106001, "キャル", 257, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 47);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 258, "忘れてきちゃいました☆", 42);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 2, "", 0, 106001, "キャル", 259, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 48);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 260, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 35);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 2, "", 0, 106001, "キャル", 261, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 49);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 262, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 43);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 2, "", 0, 106001, "キャル", 263, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 50);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 264, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 36);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 2, "", 0, 106001, "キャル", 265, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 51);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 266, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 37);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 2, "", 0, 106001, "キャル", 267, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 52);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 268, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 44);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 269, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 38);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 270, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 45);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 2, "", 0, 106001, "キャル", 271, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 53);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 272, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 46);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80003, 0, 0, 0, "", 0, 190801, "カリン", 273, "こんにちは\n【ギルド管理協会】のカリンです", 18);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80003, 0, 0, 0, "", 0, 190801, "カリン", 274, "昨日の生放送は\nいかがだったでしょうか？", 19);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80003, 0, 0, 0, "", 0, 190801, "カリン", 275, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 20);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80003, 0, 0, 0, "", 0, 190801, "カリン", 276, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 21);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80003, 0, 0, 0, "", 0, 190801, "カリン", 277, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 22);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80003, 0, 0, 0, "", 0, 190801, "カリン", 278, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 23);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80003, 0, 0, 0, "", 0, 190801, "カリン", 279, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 24);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80003, 0, 0, 0, "", 0, 190801, "カリン", 280, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 25);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80003, 0, 0, 0, "", 0, 190801, "カリン", 281, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 26);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80003, 0, 0, 0, "", 0, 190801, "カリン", 282, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 27);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 283, "準備はいいですかっ？\n…いっきますよー！", 47);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 2, "", 0, 106001, "キャル", 284, "祝！", 54);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 285, "2.5周年！", 39);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 286, "おめでとうございま～す☆", 48);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 2, "", 0, 106001, "キャル", 287, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 55);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 288, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 40);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 289, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 49);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 2, "", 0, 106001, "キャル", 290, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 56);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 291, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 41);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 2, "", 0, 106001, "キャル", 292, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 57);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 293, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 50);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 2, "", 0, 106001, "キャル", 294, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 58);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 295, "記念日だから\n平気平気♪\nやばいですね☆", 51);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 2, "", 0, 106001, "キャル", 296, "意味分かんないわよ！", 59);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 297, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 42);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 298, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 43);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 299, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 52);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 2, "", 0, 106001, "キャル", 300, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 60);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 1, "", 0, 105901, "コッコロ", 301, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 44);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 302, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 53);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80003, 1, 0, 0, "105901,45,106001,61", 0, 105801, "ペコリーヌ・コッコロ・キャル", 303, "2.5周年\nありがとうございます！", 54);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 1, "", 0, 190804, "カリン", 304, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 1, 0, "", 305, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 1, 0, "", 306, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 1, 0, "", 307, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 1, 0, "", 308, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 2, 2, "", 1, 0, "", 309, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 2, 0, "", 310, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 2, 0, "", 311, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 2, 0, "", 312, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 2, 0, "", 313, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 2, 2, "", 2, 0, "", 314, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 3, 0, "", 315, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 3, 0, "", 316, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 3, 0, "", 317, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 3, 0, "", 318, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 3, 0, "", 319, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 3, 0, "", 320, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 2, 2, "", 3, 0, "", 321, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 4, 0, "", 322, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 4, 0, "", 323, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 4, 0, "", 324, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 4, 0, "", 325, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 4, 0, "", 326, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 1, 2, "", 4, 0, "", 327, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 2, 2, "", 4, 0, "", 328, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60002, 0, 0, 3, "", 0, 190804, "カリン", 329, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 60002, 0, 0, 3, "", 0, 190804, "カリン", 330, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 4, "", 0, 105901, "コッコロ", 331, "ささ、シェフィさまはこちらへ…", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 332, "コッコロさん、どこへ行くの…？\n…え？", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 333, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 4, "", 0, 105901, "コッコロ", 334, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 335, "ええと…\n二人とも何をしているの？", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 1, "", 0, 106001, "キャル", 336, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 337, "あの日…？", 3);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 338, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 339, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 3);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 2, "", 0, 190801, "カリン", 340, "やばいですね☆", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 1, "", 0, 106001, "キャル", 341, "って、なにしれっと\n参加してんのよカリン！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 2, "", 0, 190801, "カリン", 342, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 2);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 2, "", 0, 190801, "カリン", 343, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 3);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 344, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 4);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (1, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 345, "えっ！？　ええとええと…！\nあ、あと14日…！", 4);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 346, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 5);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 347, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 3);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 348, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 4);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 349, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 6);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 350, "さすがでございます\nペコリーヌさま", 5);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 0, "", 0, 106001, "キャル", 351, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 3);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 352, "しゃなり、しゃなり…\nふふ、案外できるものね", 5);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 353, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 7);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 354, "さ、次はキャルさまの\n番でございますよ", 6);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 0, "", 0, 106001, "キャル", 355, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 4);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 356, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 6);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 0, "", 0, 106001, "キャル", 357, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 5);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 0, "", 0, 106001, "キャル", 358, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 6);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 359, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 7);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (2, 80005, 0, 0, 0, "", 0, 106001, "キャル", 360, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 7);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 361, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 8);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 362, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 8);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 363, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 9);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 364, "聖学祭…って、なにかしら？", 7);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 365, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 10);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80005, 0, 0, 0, "", 0, 106001, "キャル", 366, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 8);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80005, 0, 0, 0, "", 0, 106001, "キャル", 367, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 9);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 368, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 9);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80005, 0, 0, 0, "", 0, 106001, "キャル", 369, "いや、そのまんますぎでしょ…", 10);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 370, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 8);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 371, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 10);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (3, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 372, "えっ？　ええ…\nぎゅーっ…？", 9);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80005, 0, 0, 0, "", 0, 106001, "キャル", 373, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 11);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 374, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 10);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80005, 0, 0, 0, "", 0, 106001, "キャル", 375, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 12);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 376, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 11);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80005, 0, 0, 0, "", 0, 106001, "キャル", 377, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 13);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 378, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 11);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80005, 0, 0, 0, "", 0, 106001, "キャル", 379, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 14);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80005, 0, 0, 0, "", 0, 106001, "キャル", 380, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 15);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 381, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 11);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 382, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 12);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 383, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 12);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80005, 0, 0, 0, "", 0, 106001, "キャル", 384, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 16);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (4, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 385, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 12);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 386, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 13);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 387, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 14);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 388, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 15);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80005, 0, 0, 0, "", 0, 106001, "キャル", 389, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 17);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80005, 0, 0, 0, "", 0, 106001, "キャル", 390, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 18);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 391, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 13);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 392, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 13);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 393, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 16);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80005, 0, 0, 0, "", 0, 106001, "キャル", 394, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 19);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 395, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 17);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 396, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 18);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (5, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 397, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 19);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80005, 0, 0, 2, "", 0, 190801, "カリン", 398, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 4);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80005, 0, 0, 2, "", 0, 190801, "カリン", 399, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 5);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80005, 0, 0, 1, "", 0, 106001, "キャル", 400, "…えっ！？", 20);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 401, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 20);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 402, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 14);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80005, 0, 0, 4, "", 0, 105901, "コッコロ", 403, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 14);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 404, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 15);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80005, 0, 0, 1, "", 0, 106001, "キャル", 405, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 21);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 406, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 21);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80005, 0, 0, 1, "", 0, 106001, "キャル", 407, "ぶっ殺すぞ！？", 22);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (6, 80005, 0, 0, 2, "", 0, 190801, "カリン", 408, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 6);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 409, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 15);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80005, 0, 0, 0, "", 0, 106001, "キャル", 410, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 23);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 411, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 16);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 412, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 22);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80005, 0, 0, 0, "", 0, 106001, "キャル", 413, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 24);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 414, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 17);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 415, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 16);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 416, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 18);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 417, "もちろんでございます\n仲良くお勉強いたしましょう", 17);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80005, 0, 0, 0, "", 0, 106001, "キャル", 418, "しれっと教育ママが\n生まれてる…？", 25);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 419, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 23);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (7, 80005, 0, 0, 0, "", 0, 106001, "キャル", 420, "え～～～～！？", 26);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80005, 0, 0, 0, "", 0, 106001, "キャル", 421, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 27);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 422, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 19);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 423, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 18);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 424, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 24);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 425, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 20);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80005, 0, 0, 0, "", 0, 106001, "キャル", 426, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 28);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 427, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 19);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 428, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 21);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80005, 0, 0, 0, "", 0, 106001, "キャル", 429, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 29);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80005, 0, 0, 0, "", 0, 106001, "キャル", 430, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 30);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 431, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 25);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (8, 80005, 0, 0, 0, "", 0, 106001, "キャル", 432, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 31);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 433, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 22);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 434, "…えっ？\n生放送の意気込み！？\n突然なに！？", 23);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 435, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 24);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 436, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 25);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 437, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 26);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 438, "それから、それから…！\nぅ、ぅぅっ…！", 27);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 439, "―びえぇぇ～んっ！！！", 28);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 440, "どうされましたか、シェフィさま", 20);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 441, "ううっ…ひっく…\nママッ…！", 29);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 442, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 21);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 443, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 22);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (9, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 444, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 30);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80005, 0, 0, 0, "", 0, 105901, "コッコロ", 445, "主さま\n3.5周年まであと５日\nでございます", 23);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80005, 0, 0, 0, "", 0, 105901, "コッコロ", 446, "ですがその前に\n生放送がありますね", 24);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80005, 0, 0, 0, "", 0, 105901, "コッコロ", 447, "…生放送に向けた\n意気込みでございますか？", 25);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80005, 0, 0, 0, "", 0, 105901, "コッコロ", 448, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 26);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80005, 0, 0, 0, "", 0, 105901, "コッコロ", 449, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 27);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80005, 0, 0, 0, "", 0, 105901, "コッコロ", 450, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 28);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80005, 0, 0, 0, "", 0, 105901, "コッコロ", 451, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 29);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80005, 0, 0, 0, "", 0, 105901, "コッコロ", 452, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 30);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (10, 80005, 0, 0, 0, "", 0, 105901, "コッコロ", 453, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 31);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80005, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 454, "3.5周年まであと４日！\nやばいですね☆", 26);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80005, 0, 0, 1, "", 0, 106001, "キャル", 455, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 32);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80005, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 456, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 27);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80005, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 457, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 28);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80005, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 458, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 29);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80005, 0, 0, 1, "", 0, 106001, "キャル", 459, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 33);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80005, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 460, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 30);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80005, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 461, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 31);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80005, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 462, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 32);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80005, 0, 0, 1, "", 0, 106001, "キャル", 463, "だからあたしはやるなんて一言も…", 34);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80005, 0, 0, 0, "", 0, 105801, "ペコリーヌ", 464, "オイッスー☆", 33);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (11, 80005, 0, 0, 1, "", 0, 106001, "キャル", 465, "聞きなさいっての！！", 35);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 466, "3.5周年まであと３日…\nそして生放送は、明日…", 31);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 467, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 32);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 468, "おいっす！\n…こうじゃなかったわね\nええと確か…", 33);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 469, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 34);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 470, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 35);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 471, "やってますねシェフィちゃん！", 34);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80005, 0, 0, 0, "", 0, 106001, "キャル", 472, "なによ、考えることは\nみんな同じってこと？", 36);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 473, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 32);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 474, "みんな…もちろんよ！", 36);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (12, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 475, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 35);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 0, 0, 2, "", 0, 190801, "カリン", 476, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 7);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 0, 0, 2, "", 0, 190801, "カリン", 477, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 8);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 478, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 36);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 0, 0, 2, "", 0, 190801, "カリン", 479, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 9);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 0, 0, 4, "", 0, 105901, "コッコロ", 480, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 33);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 0, 0, 2, "", 0, 190801, "カリン", 481, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 10);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 0, 0, 1, "", 0, 106001, "キャル", 482, "大丈夫…大丈夫…\nあたしは大丈夫…", 37);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 0, 0, 2, "", 0, 190801, "カリン", 483, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 11);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 484, "あうー？", 37);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 1, 0, 4, "105901,34,106001,38,190801,12", 0, 105801, "みんな", 485, "あ…", 37);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 0, 0, 1, "", 0, 106001, "キャル", 486, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 39);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 0, 0, 4, "", 0, 105901, "コッコロ", 487, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 35);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 488, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 38);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (13, 80005, 0, 0, 2, "", 0, 190801, "カリン", 489, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 13);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 490, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 38);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 491, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 39);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80005, 0, 0, 0, "", 0, 106001, "キャル", 492, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 40);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 493, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 36);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 494, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 39);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 495, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 40);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80005, 0, 0, 1, "", 0, 105901, "コッコロ", 496, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 37);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80005, 0, 0, 0, "", 0, 106001, "キャル", 497, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 41);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 498, "へ、へぇ…", 40);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 499, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 41);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 500, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 41);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (14, 80005, 0, 0, 2, "", 0, 106401, "シェフィ", 501, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 42);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 502, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 42);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 1, "", 0, 106001, "キャル", 503, "祝！", 42);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 4, "", 0, 105901, "コッコロ", 504, "3.5周年！", 38);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 505, "おめでとうございます！", 43);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 2, "", 0, 190801, "カリン", 506, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 14);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 2, "", 0, 190801, "カリン", 507, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 15);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 508, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 43);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 509, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 44);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 1, "", 0, 106001, "キャル", 510, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 43);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 1, "", 0, 106001, "キャル", 511, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 44);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 512, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 44);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 0, "", 0, 106401, "シェフィ", 513, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 45);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 4, "", 0, 105901, "コッコロ", 514, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 39);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 4, "", 0, 105901, "コッコロ", 515, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 40);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 4, "", 0, 105901, "コッコロ", 516, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 41);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 0, 0, 3, "", 0, 105801, "ペコリーヌ", 517, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 45);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (15, 80005, 1, 0, 4, "105901,42,106001,45,106401,46,190801,16", 0, 105801, "みんな", 518, "これからも\nよろしくおねがいします！", 46);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 1, "", 0, 190804, "カリン", 519, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 1, 0, "", 520, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 1, 0, "", 521, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 1, 0, "", 522, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 1, 0, "", 523, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 2, 2, "", 1, 0, "", 524, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 2, 0, "", 525, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 2, 0, "", 526, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 2, 0, "", 527, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 2, 0, "", 528, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 2, 2, "", 2, 0, "", 529, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 3, 0, "", 530, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 3, 0, "", 531, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 3, 0, "", 532, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 3, 0, "", 533, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 3, 0, "", 534, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 3, 0, "", 535, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 2, 2, "", 3, 0, "", 536, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0);
INSERT INTO `v1_ae8e010fb5840b47b4666508ddea4789fc373742387a3dde244818da545eb7d6` VALUES (0, 60003, 0, 1, 2, "", 4, 0, "", 537, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0);
